import p1_img from '../Assets/city.jpg'
import p2_img from '../Assets/black-whitecity.jpg'


// Define your image data
let data_product = [
  {
    id: 1,
    name: 'Big colored city',
    image:p1_img,
    new_price:700.00,
    old_price:1200.00,
  },
  {
    id: 2,
    name: 'A black and white city',
    image:p2_img,
    new_price:800.00,
    old_price:1200.00,
  },
  // Add more image objects as needed
];

export default data_product;
